import React, { PureComponent } from 'react'

import Outer from './styled/Outer'
import Intro from './styled/Intro'
import IntroBold from './styled/IntroBold'
import IntroDiv from './styled/IntroDiv'

import profileImage from './profilePic.jpeg'

export default class Home extends PureComponent {
    constructor(props) {
        super(props)
        this.state = {}
    }

    calc = () => {
        let optionPrice = 50;
        let startingCap = 500;
        let earnings = [];
        let weeklyEarnings = [];

        //every day you take 20% profits

        //week loop
        for(let i = 0; i < 6; i++){
            startingCap += (startingCap * .20);
            startingCap = startingCap.toFixed(2);
            console.log(startingCap);
            weeklyEarnings.push(startingCap);
        }
    }

    render() {
        return (
            <Outer>
                <img src={profileImage} alt="avatar" />
                <IntroDiv>
                    {/* <Intro>
                        Welcome!
                    </Intro>            
                    <IntroBold>
                        My name is Burke
                    </IntroBold>
                    <Intro>
                        I am a full stack web developer
                    </Intro> */}
                    {this.calc}
                </IntroDiv>
            </Outer>
        )
    }
}
